import { styled } from "styled-components";

export const Container = styled.div`
  position: relative;
  width: 393px;
  height: 933px;
  background: #38145d;
  align-items: center;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
`;

export const Bar = styled.div`
  display: flex;
  flex-direction: row;
  width: 393px;
  height: 44px;
  flex-shrink: 0;
  #Time {
    margin-top: 15px;
    margin-left: 15px;
    float: left;
    color: #fff;
    text-align: center;
    font-family: "Pretendard Variable";
    font-size: 18px;
    font-style: normal;
    font-weight: 500;
    line-height: 25px; /* 138.889% */
    width: 80px;
  }
  #Connection {
    margin-top: 17px;
    margin-left: 220px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
  #Wifi {
    margin-top: 17px;
    margin-left: 15px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
  #Battery {
    margin-top: 17px;
    margin-left: 10px;
    margin-right: 8px;
    width: 25px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
`;

export const Search = styled.div`
  display: flex;
  flex-direction: row;
  position: relative;
  width: 393px;
  height: 933px;
`;

export const Backbtn = styled.div`
  margin-top: 15px;
  margin-left: 15px;
  width: 30px;
  height: 30px;
  flex-shrink: 0;
`;

export const SearchBar = styled.div`
  display: flex;
  width: 280px;
  height: 43px;
  justify-content: center;
  align-items: center;
  flex-shrink: 0;
  border-radius: 20px;
  border: 1px solid #a065ff;
  box-shadow: 0px 4px 4px 0px rgba(160, 101, 255, 0.1);
`;
